import React from 'react';
import { Page } from "./Page";
import { useParams } from "react-router-dom";
import {AddWishForm} from "../components/forms/AddWishForm";

function Box({ icon, title, description }) {
    return (
      <div className="bg-white p-6 rounded-lg shadow-md">
        <div className="flex items-center mb-4">
          <div className="mr-4">
            <svg
              className="w-8 h-8 fill-current text-gray-600"
              xmlns="http://www.w3.org/2000/svg"
              viewBox="0 0 24 24"
            >
              {icon}
            </svg>
          </div>
          <h3 className="text-xl font-semibold text-gray-800">{title}</h3>
        </div>
        <p className="text-gray-600">{description}</p>
        <button className="mt-4 px-4 py-2 bg-blue-500 text-white rounded-lg">Button</button>
      </div>
    );
  }

export const AddWish = () => {
    const { hash } = useParams();

    return (
        <Page>
            <div className="container mx-auto px-20">
                <div className="flex flex-col items-center justify-center py-12">
                    <h1 className="text-4xl font-bold text-center">
                        Add a wish to
                    </h1>
                    <h2 className="text-xl font-semibold text-center text-gray-600">
                        My test wishlist
                    </h2>
                </div>
            </div>
            <div className="bg-neutral py-5 flex-auto">
                <div className="container mx-auto px-20">
                    <div className="">
                        <AddWishForm hash={hash} />
                    </div>
                </div>
            </div>
        </Page>
    );
};
